    private void residencyYearActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_residencyYearActionPerformed
        if (evt.getSource()== residencyYear){
            JComboBox cb = (JComboBox)evt.getSource();
            //MedExperience medEx = (MedExperience)cb.getSelectedItem();
           String medExp = (String)cb.getSelectedItem();
           switch (medExp){
               case "N/A" : medExperience = MedExperience.NA;
                    break;
               case "1": medExperience = MedExperience.ONE;
                    break;
               case "2": medExperience = MedExperience.TWO;
                    break;
               case "3": medExperience = MedExperience.THREE;
                    break;
               case "4": medExperience = MedExperience.FOUR;
                    break;  
               case "5": medExperience = MedExperience.FIVE;
                    break;
               case "6": medExperience = MedExperience.SIX;
                    break;
               case "7": medExperience = MedExperience.SEVEN;
                    break;          
           }
           //JOptionPane.showMessageDialog(null, "MedEx: " + medExperience, "", JOptionPane.INFORMATION_MESSAGE);
        }
        else{
           // JOptionPane.showMessageDialog(null, "Hand is: " + handedness, "ELSE PATH", JOptionPane.INFORMATION_MESSAGE);
        }

    }//GEN-LAST:event_residencyYearActionPerformed

